Not to get too deep here, but I feel that being tall, skinny and a touch feminine for the best part of my life has always put me at a slight disadvantage amongst the lads. That is, in a world of where the majority are overweight and we're sold an idea of how lads are supposed to look and act. Not to say that we shouldn't strive to exercise n eat well to improve our physique (I do), but we shouldn't be doing it to live up to any unrealistic expectations.  We're all genetically different, and ik it's cliche but unique. I have a fast metabolism and I'm in touch with my feminine side. Does that make me weak? No. Does that make me gay? No. Do I like what I see when I look in the mirror? Mmm sometimes I nick pick, but ultimately yes.

Lads, and Ladies too, LOVE YASELF. Love this picture of me in my Velvet Underground vest (I made it myself). Be positive 🙏🏻

